import sary from "./fi.jpg";
import "./style.css";

function Item({ name, isPacked }) {
    return (
        <li className="item">
          {name} {isPacked && '✔'}
        </li>
      );
  }
  
  export default function PackingList() {
    return (
      <section>
        <h1>Sally Ride's Packing List</h1>
        <ul>
          <Item 
            isPacked={true} 
            name="Space suit" 
          />
          <Item 
            isPacked={true} 
            name="Helmet with a golden leaf" 
          />
          <Item 
            isPacked={false} 
            name="Photo of Tam" 
          />
        </ul>
        <img 
            src={sary}
            alt="finaritra"
        />
      </section>
    );
  }
